DROP TABLE PEDIDO_PRODUCTO;
DROP TABLE PEDIDO;
DROP TABLE CUOTA_TRIMESTRAL;
DROP TABLE VENDEDOR;
DROP TABLE CLIENTE;
DROP TABLE PRODUCTO;

DROP SEQUENCE SEQ_VENDEDOR;
DROP SEQUENCE SEQ_PEDIDO;

CREATE TABLE VENDEDOR(
    COD_VENDEDOR NUMBER(6) PRIMARY KEY,
    NOMBRE_COMPLETO VARCHAR2(100)
);

CREATE TABLE CLIENTE(
    N_DOCUMENTO_CLIENTE NUMBER(11) PRIMARY KEY,
    TIPO_DOCUMENTO VARCHAR2(5),
    NOMBRE VARCHAR2(120) NOT NULL,
    TIPO VARCHAR2(50),
    UBIC_REFER VARCHAR2(30),
    UBIC_DISTRITO VARCHAR2(30) NOT NULL,
    UBIC_DIRECCION VARCHAR2(200) NOT NULL
);

CREATE TABLE PEDIDO(
    N_PEDIDO NUMBER(20) NOT NULL,
    N_DOCUMENTO_CLIENTE NUMBER(20) REFERENCES CLIENTE NOT NULL,
    COD_VENDEDOR NUMBER(10) REFERENCES VENDEDOR NOT NULL,    
    CONDICION_PAGO VARCHAR2(30) NOT NULL,
    N_COMPROBANTE VARCHAR2(20) NOT NULL,
    TOTAL_VALOR_VENTA FLOAT,
    DESCUENTO_TOTAL FLOAT,
    FECHA DATE NOT NULL,
    CONSTRAINT PK_PEDIDO PRIMARY KEY(N_PEDIDO, N_DOCUMENTO_CLIENTE)
);

CREATE TABLE PRODUCTO(
    COD_PRODUCTO VARCHAR2(50) PRIMARY KEY,
    FAMILIA VARCHAR2(50),
    LINEA VARCHAR2(50),
    SUBLINEA VARCHAR2(50),
    VALOR_VENTA FLOAT,
    DESCRIPCION VARCHAR2(200)
);

CREATE TABLE CUOTA_TRIMESTRAL(
    COD_CUOTA NUMBER(8) PRIMARY KEY,
    COD_VENDEDOR NUMBER(6) REFERENCES VENDEDOR NOT NULL,
    COD_PRODUCTO VARCHAR(15) REFERENCES PRODUCTO NOT NULL,
    FECHA DATE NOT NULL,
    CANTIDAD NUMBER(4) NOT NULL
);

CREATE TABLE PEDIDO_PRODUCTO(
    N_PEDIDO NUMBER(20) NOT NULL,
    N_DOCUMENTO_CLIENTE NUMBER(20) NOT NULL REFERENCES CLIENTE,
    COD_PRODUCTO VARCHAR(20) REFERENCES PRODUCTO NOT NULL,
    CANTIDAD NUMBER(20) NOT NULL,
    CONSTRAINT PK_PEDIDO_PRODUCTO PRIMARY KEY(N_PEDIDO, N_DOCUMENTO_CLIENTE, COD_PRODUCTO)
);

CREATE SEQUENCE SEQ_VENDEDOR START WITH 100000 INCREMENT BY 1;
CREATE SEQUENCE SEQ_PEDIDO START WITH 13000 INCREMENT BY 1;







